import React, { useContext, useEffect, useState } from "react";
import { useParams } from "react-router-dom";
import { RestaurantsContext } from "../context/RestaurantsContext";
import RestaurantFinder from "../apis/RestaurantFinder";
import StarRating from "../components/StarRating";
import Reviews from "../components/Reviews";
import AddReview from "../components/AddReview";
import RestaurantDetailHeader from "../components/RestaurantDetailHeader";
import Cart from "../components/elements/Cart";
import ProductCard from "../components/elements/ProductCard";
import Loading from "../components/Loading";

const RestaurantDetailPage = () => {

  const { cart, setCart } = useState([]);

  const { id } = useParams();
  const { selectedRestaurant, setSelectedRestaurant } = useContext(
    RestaurantsContext
  );

  // console.log(selectedRestaurant);


  useEffect(() => {
    const fetchData = async () => {
      try {
        const response = await RestaurantFinder.get(`/${id}`);
        console.log(response.data.data);

        setSelectedRestaurant(response.data.data);
      } catch (err) {
        console.log(err);
      }
    };

    fetchData();
  }, []);


  if (selectedRestaurant === null) {
    return (
      <Loading />
    )
  }

  
  const addToCart = (product) => {
    // alert(product.name)
    let newCart = cart;
    // var addedItem = newCart.find(c => c.product.product_id === product.product_id);
    setCart(...cart,product)
  }

  return (
    // <div>
    //   {selectedRestaurant && (
    //     <>
    //       <h1 className="text-center display-1">
    //         {selectedRestaurant.restaurant.name}
    //       </h1>
    //       <div className="text-center">
    //         <StarRating rating={selectedRestaurant.restaurant.average_rating} />
    //         <span className="text-warning ml-1">
    //           {selectedRestaurant.restaurant.count
    //             ? `(${selectedRestaurant.restaurant.count})`
    //             : "(0)"}
    //         </span>
    //       </div>
    //       <div className="mt-3">
    //         {/* {console.log(selectedRestaurant.reviews[selectedRestaurant.reviews.length-1, selectedRestaurant.reviews.length-2])} */}
    //         <Reviews reviews={selectedRestaurant.reviews} />
    //       </div>
    //       <AddReview />
    //     </>
    //   )}
    // </div>

    <div className='md:container mx-auto pt-8 relative'>
      <RestaurantDetailHeader
        restaurant_name={selectedRestaurant.restaurant.name}
        restaurant_picture={selectedRestaurant.restaurant.picture}
        rating={selectedRestaurant.restaurant.average_rating}
        review_count={selectedRestaurant.restaurant.count}
        reviews={selectedRestaurant.reviews}
        review1={selectedRestaurant.reviews[selectedRestaurant.reviews.length - 1]}
        review2={selectedRestaurant.reviews[selectedRestaurant.reviews.length - 2]}
      />
      {/* {console.log(selectedRestaurant.products)} */}
      {/* {console.log(selectedRestaurant.reviews[selectedRestaurant.reviews.length-1])} */}
      <div className='flex mt-12 gap-x-10'>
        <div className='sticky top-0'>
          <Cart cart ={cart} />
        </div>

        <div>
          <div className='my-5'>
            <h1 className='text-2xl font-semibold text-orange-500 mb-2'>Menüler</h1>
            <div className='bg-gray-700 h-px'></div>
          </div>
          <div className='grid grid-cols-2 grid-flow-row gap-5 mt-5'>
            {selectedRestaurant.products.map((product, index) => {
              return (
                // <ProductCard
                //   key={item.product_id}
                //   name={item.name}
                //   price = {item.price}
                //   explanation = {item.explanation}
                //   picture={item.picture}
                // />
                <div key={index} className="overflow-hidden max-w-lg max-h-52 p-8 sm:flex sm:space-x-6 bg-white rounded-xl transform transition-all hover:-translate-y-2 duration-300 shadow-lg hover:shadow-2xl cursor-pointer relative">
                  <div className="flex-shrink-0 w-full mb-6 h-44 sm:h-32 sm:w-32 sm:mb-0">
                    <img src={product.picture} alt="" className="object-cover object-center w-full h-full rounded dark:bg-gray-500" />
                  </div>
                  <div className="flex flex-col space-y-4">
                    <div>
                      <h2 className="text-xl font-semibold text-orange-500">{product.name}</h2>
                      <span className="text-sm dark:text-gray-400">{product.explanation}</span>
                    </div>
                    <div className='flex gap-x-1 items-center'>
                      <span className="text-lg font-semibold">{product.price} TL</span>
                      {/* <span className="text-sm line-through dark:text-gray-600">indrimsiz TL</span> */}
                    </div>
                    <div className="space-y-1 absolute bottom-2 right-4">
                      <button onClick={() => addToCart(product)} className='p-1.5 bg-orange-500 text-white font-medium rounded-md'>Sepete ekle</button>
                    </div>
                  </div>
                </div>
              );
            })}
          </div>
        </div>
        {/* <div >
          <div className='my-5'>
            <h1 className='text-2xl font-semibold text-orange-500 mb-2'>Tavuk Dürümler</h1>
            <div className='bg-gray-700 h-px'></div>
          </div>
          <div className='grid grid-cols-2 grid-flow-row gap-5 mt-5'>
            <ProductCard />
            <ProductCard />
            <ProductCard />
            <ProductCard />
            <ProductCard />
            <ProductCard />
            <ProductCard />
            <ProductCard />
            <ProductCard />
          </div>

          <div className='my-5'>
            <h1 className='text-2xl font-semibold text-orange-500 mb-2'>Pizzalar</h1>
            <div className='bg-gray-700 h-px'></div>
          </div>

          <div className='grid grid-cols-2 grid-flow-row gap-5'>
            <ProductCard />
            <ProductCard />
            <ProductCard />
            <ProductCard />
            <ProductCard />
            <ProductCard />
            <ProductCard />
            <ProductCard />
            <ProductCard />
          </div>
        </div> */}
      </div>
    </div>

  );
};

export default RestaurantDetailPage;
